import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import './Header.css';
import { connect} from 'react-redux';
// const styles = {
//   root: {
//     flexGrow: 1,
//   },
//   appBar: {
//     backgroundColor: 'red'
//   },
//   grow: {
//     flexGrow: 1,
//   },
//   menuButton: {
//     marginLeft: -12,
//     marginRight: 20,
//   },
// };

const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: 'red'
  },
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20,
  },
});

class Header extends React.Component {
  // const { classes } = props;
  constructor() {
    super();
    this.state = {
      isAuthenticated: false,
      userType: ''
    }
  }
  render() {
  const { classes, theme } = this.props;
  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar>
          <Link to={'/'} style={{width: '40px'}}>
            <img src={require('../../assets/img/red_cross.jpg')} alt="red cross" className="headerLogo"/>
            </Link>
          <Typography variant="h6" color="inherit" className={classes.grow}>
            Centennial Health
          </Typography>
            {!this.state.isAuthenticated ? (<React.Fragment>
            <Link to={'/login'} className="headerLink"><Button color="inherit">Login</Button></Link>
            <Link to={'/register'} className="headerLink"><Button color="inherit">Register</Button></Link>
            </React.Fragment>) : this.state.userType === 'PT' ? (<React.Fragment>
            <Link to={'/symptoms'} className="headerLink"><Button color="inherit">Symptom Checker</Button></Link>
            <Link to={'/tips'} className="headerLink"><Button color="inherit">Health Tips</Button></Link>
            <Link to={'/update_info'} className="headerLink"><Button color="inherit">Update Info</Button></Link>
            <Link to={'/logout'} className="headerLink"><Button color="inherit">Log Out</Button></Link>
            </React.Fragment>) : 
            (<React.Fragment>
              <Link to={'/add_tip'} className="headerLink"><Button color="inherit">Add Tip</Button></Link>
              <Link to={'/view_results'} className="headerLink"><Button color="inherit">View Results</Button></Link>
              <Link to={'/update_patient'} className="headerLink"><Button color="inherit">Update Patient</Button></Link>
              <Link to={'/logout'} className="headerLink"><Button color="inherit">Log Out</Button></Link>
              </React.Fragment>)}
        </Toolbar>
      </AppBar>
    </div>
  )
  };
}

Header.propTypes = {
  classes: PropTypes.object.isRequired,
};

const mapStateToProps = state => {
  return {
    isAuthenticated: state.isAuthenticated
  };
};

const mapDispatchToProps = dispatch => {
  return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(withStyles(styles)(Header));
